import './HelpersModal.scss'

export const HelpersModal = (props) => {

    return (
       <div className="helpers-modal">
            <div className="helpers-label-header">List Helpers...</div>
            <input type="text" placeholder="Search labels..."/>
            <div className="labels">
                <div className="add-card" onClick={props.toggleItemForm}></div>
            </div>
        </div>
    )
}
